import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Submissions from './Lecturers/submission';

function App() {
  return (
    <Router>
      <div className="App">
        {/* Set up routes */}
        <Routes>
          <Route
            path="/submissions/:taskId"
            element={<Submissions />} // This is the component that will handle the submission fetching
          />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
